INSERT INTO `tbl_about` (`id`, `content`, `add_by`, `date_created`, `modify_by`, `date_modify`) VALUES
(1, '<p><strong>HuntsmanWar is an Ultimate Solution to all your eSports Games.</strong></p>\r\n\r\n<p><strong>HuntsmanWar is an Online Portal which Offers Rewards and Unlimited Entertainment for Participating and Playing Games Online. Users can play online multiple games like Battlegrounds Mobile India (BGMI), Free Fire, Call Of Duty Mobile, etc. and Earn Cash Rewards and Prizes based on their in-game performance..</strong></p>\r\n\r\n<p><strong>Founded and Launched on 22th Dec, 2021, was developed by two young minds from Gujarat, India!</strong></p>\r\n\r\n<p><strong>You might be addicted to Online Games but just think what if you can start making money or living by Playing Mobile Games? Well, this is what HuntsmanWar Offers. Users can participate in the upcoming eSports games and Win Amazing Prizes and Rewards.</strong></p>\r\n\r\n<p><strong>Participate in the Tournaments of Games like Free Fire, Call Of Duty Mobile, Fortnite, Battlegrounds Mobile India etc. and Earn Huge Rewards Daily. Users can join Custom Rooms, and Get Rewards for Chicken Dinner and also for each Kill they Score. Sounds cool, huh?? Give it a try!</strong></p>\r\n', 9, '2019-01-08 19:01:25', 6, '2021-12-22 11:12:51');
