INSERT INTO `tbl_privacy_policy` (`id`, `content`, `add_by`, `date_created`, `modify_by`, `date_modify`) VALUES
(1, '<p><strong>Huntsmanwar built the Huntsmanwar app as a Free app. This SERVICE is provided by Huntamanwar at no cost and is intended for use as is.</strong></p>\r\n\r\n<p><strong>This page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.</strong></p>\r\n\r\n<p><strong>If you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. We will not use or share your information with anyone except as described in this Privacy Policy.</strong></p>\r\n\r\n<p><strong>The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which is accessible at Huntsmanwar unless otherwise defined in this Privacy Policy.</strong></p>\r\n\r\n<p><strong>Information Collection and Use</strong></p>\r\n\r\n<p><strong>For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to Name, Email Address, Mobile Number. The information that we request will be retained by us and used as described in this privacy policy.</strong></p>\r\n\r\n<p><strong>The app does use third party services that may collect information used to identify you.</strong></p>\r\n\r\n<p><strong>Link to privacy policy of third party service providers used by the app Google Play Services, AdMob, Firebase Analytics</strong></p>\r\n\r\n<p><strong>Log Data</strong></p>\r\n\r\n<p><strong>We want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (&ldquo;IP&rdquo;) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.</strong></p>\r\n\r\n<p><strong>Cookies</strong></p>\r\n\r\n<p><strong>Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device&#39;s internal memory.</strong></p>\r\n\r\n<p><strong>This Service does not use these &ldquo;cookies&rdquo; explicitly. However, the app may use third party code and libraries that use &ldquo;cookies&rdquo; to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.</strong></p>\r\n\r\n<p><strong>Service Providers</strong></p>\r\n\r\n<p><strong>We may employ third-party companies and individuals due to the following reasons:</strong></p>\r\n\r\n<p><strong>1. To facilitate our Service;<br />\r\n2. To provide the Service on our behalf;<br />\r\n3. To perform Service-related services; or<br />\r\n4. To assist us in analyzing how our Service is used.<br />\r\n&gt;<br />\r\nWe want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.</strong></p>\r\n\r\n<p><strong>Security</strong></p>\r\n\r\n<p><strong>We value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.</strong></p>\r\n\r\n<p><strong>Links to Other Sites</strong></p>\r\n\r\n<p><strong>This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. We have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.</strong></p>\r\n\r\n<p><strong>Children&rsquo;s Privacy</strong></p>\r\n\r\n<p><strong>These Services do not address anyone under the age of 13. We do not knowingly collect personally identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.</strong></p>\r\n\r\n<p><strong>Changes to This Privacy Policy</strong></p>\r\n\r\n<p><strong>We may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Privacy Policy on this page. These changes are effective immediately after they are posted on this page.</strong></p>\r\n\r\n<p><strong>Contact Us</strong></p>\r\n\r\n<p><strong>If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us</strong></p>\r\n', 0, '2019-07-16 00:00:00', 6, '2021-12-27 20:31:42');
