INSERT INTO `tbl_rules` (`rule_id`, `rule_type`, `rule_title`, `rules`, `date_created`) VALUES
(6, 0, 'FREEFIRE', '<p><strong>Steps to join FREE FIRE Room :-&nbsp;</strong></p>\r\n\r\n<p><strong>Level must be more than 35 .</strong></p>\r\n\r\n<p><strong>PLayers level less than 35 will be kicked ad no refund will be provided</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Must Enter Your Real User name.</strong></li>\r\n	<li><strong>If the contest is not full then the priza will be reduced.</strong></li>\r\n</ul>\r\n\r\n<p><strong>1. Admins have all the right to kick anyone amd admin&#39;s decision is final decision.</strong></p>\r\n\r\n<p><strong>2. If in anyway you fail to join the room by the match start time then we are not responsible for it. Refund in such cases would not be processed. So make sure to join on time.&nbsp;</strong></p>\r\n\r\n<p><strong>3. Do not share the Room ID &amp; Password with anyone who has not joined the match. If you are found doing so, your account may get terminated and all the winnings will be lost.&nbsp;</strong></p>\r\n\r\n<p><strong>4. Griefing and Teaming is against the game rules. Any participant found doing so will be disqualified and their prizes will be lost.&nbsp;</strong></p>\r\n\r\n<p><strong>5. Room lD and Password will be shared in the app before 8 minutes of match start time.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. &nbsp;Match start after 8 minutes of Sharing Room ID and Password. Make sure to grab ID and Password before the Match Start Time.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>7.Make sure you join the Match Room ASAP, before the match starts.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>8. This match is Paid match. To participate, you have to pay the entry fee amount. There are total 60 spots available. Join it before all the spots are filled.&nbsp;</strong></p>\r\n\r\n<p><strong>9. Please note that the listed entry fee is per individual and not the squad/duo team. Each member of a team (Squad or Duo) has to pay the entry fee and register individually for the match or tournament. Once you join the match custom room, do not keep changing your position. If you do so, you may get kicked from the room.&nbsp;</strong></p>\r\n\r\n<p><strong>10.Spots are given on the First Come First Basis.&nbsp;</strong></p>\r\n\r\n<p><strong>11. Last standing man gets the win prize. You will be also rewarded for each kill. Check the rewards details above.&nbsp;</strong></p>\r\n\r\n<p><strong>12. only Mobile Device to Join Match. Do not use any Hacks or Emulators.&nbsp;</strong></p>\r\n\r\n<p><strong>&nbsp;13. &nbsp;If anyone found violating these rules then immediate action will be taken and respective accounts may get banned and rewards may be abandoned.</strong></p>\r\n', '2021-12-23 14:36:23'),
(4, 1, 'Rulse', '<ul>\r\n	<li><strong>You must be 16/18/21 years of age or older to buy Lottery tickets and claim prizes.</strong></li>\r\n	<li><strong>Players are responsible for checking their tickets before leaving the Retailer location.</strong></li>\r\n	<li><strong>A ticket is void if stolen, unissued, mutilated, illegible, tampered with or altered in any way, defective or incomplete.</strong></li>\r\n	<li><strong>The Lottery is not responsible for lost or stolen tickets.</strong></li>\r\n	<li><strong>A Lotto/Lottery ticket may be cancelled only if presented before the drawing to the Retailer where it was originally purchased. Powerball tickets cannot be cancelled.</strong></li>\r\n	<li><strong>Multi-drawing bets on the same number(s) may be made in advance for all games. Ask Retailer for details.</strong></li>\r\n	<li><strong>You must fill in your name, address and phone number on the back of your winning ticket before you file a prize claim.</strong></li>\r\n	<li><strong>All winning tickets are subject to validation by the Lottery.</strong></li>\r\n	<li><strong>All winning tickets are bearer instruments.</strong></li>\r\n	<li><strong>All prizes must be claimed within 6 months/one year from date of drawing.</strong></li>\r\n</ul>\r\n', '2021-04-27 10:29:59'),
(7, 0, 'LUDO', '<p><strong>Rules of ludo:-&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li><strong>Must Enter Your Real User name.</strong></li>\r\n	<li><strong>If the contest is not full then the priza will be reduced.</strong></li>\r\n</ul>\r\n\r\n<p><strong>1.) Be attentive to get your room code before 6 to 8 minutes of match time.</strong></p>\r\n\r\n<p><strong>2.) Join the room as soon as possible to grab your desired place with your Duo or squad. If you fail to join in room , then the Admin will not be responsible for it &amp; refund will not proceed in any case .</strong></p>\r\n\r\n<p><strong>3) Teaming up and any kind of unethical activity during gameplay will not be tolerated and you may also lose your winning amount.</strong></p>\r\n\r\n<p><strong>4) To join in the match, pay the entry fees which is including all taxes.</strong></p>\r\n\r\n<p><strong>5) If due to network issues you get offline in game then prize will be given to opponent.</strong></p>\r\n\r\n<p><strong>Steps To Join Ludo Room :-</strong></p>\r\n\r\n<p><strong>Click here</strong></p>\r\n', '2021-04-27 10:30:09'),
(10, 0, 'BGMI', '<h3><strong>Read Each And Every Rule Very Carefully Don&#39;t Blame Room Organizers Or Admin For Any Unhallowed Rule From Your Side.</strong></h3>\r\n\r\n<p><big><strong>&nbsp;Rule and regulation&nbsp;</strong></big></p>\r\n\r\n<ul>\r\n	<li>BGMI Accounts with level less than 30&nbsp;will be suspended from participation. Such participants will be kicked from the room and they will not be given refund.</li>\r\n	<li>if more then 6&nbsp;BGMI KD&nbsp;will be suspended from participation. Such participants will be kicked from the room and they will not be given refund.</li>\r\n	<li>If in anyway you fail to join the room by the match start time then we aren&#39;t responsible for it. Refund in such cases won&#39;t be processed. So make sure to join on time.</li>\r\n	<li>&nbsp;</li>\r\n	<li>Do not share the Room ID &amp;Password with anyone who has not joined the match. If you are found doing so, your account may get terminated and all the winnings will be lost.</li>\r\n	<li>Grieving and Teaming is against the game rules. Any participant found doing so will be disqualified and their prizes will be lost.</li>\r\n	<li>Room ID and Password will be shared in the app before 15 minutes of match start time. You might also receive Notifications.</li>\r\n	<li>Make sure to grab ID and Password before the Match Start Time.</li>\r\n	<li>Make sure you join the Match Room ASAP, before the match starts.</li>\r\n	<li>This match is Paid match. To participate, you have to pay the entry fee amount. There are total 100 spots available. Join it before all the spots are filled.</li>\r\n	<li>Please note that the listed entry fee is per individual and not the squad/duo team.</li>\r\n	<li>Each member of a team (Squad or Duo) has to pay the entry fee and register individually for the match or tournament.</li>\r\n	<li>Once you join the match custom room, do not keep changing your position. If you do so, you may get kicked from the room.</li>\r\n	<li>Spots are given on the First Come First Basis</li>\r\n	<li>Last standing man gets the Chicken Dinner Award.</li>\r\n	<li>You will be also rewarded for each kill. Check the rewards details above.</li>\r\n	<li>Do not use Screen cast while playing BGMI Matches at Owner.</li>\r\n	<li>Anybody found using Screen cast will be banned instantly without any warnings.</li>\r\n	<li>Use only Mobile Device to Join Match. Do not use any Hacks or Emulators.</li>\r\n	<li>If anyone found violating these rules then immediate action will be taken and respective accounts may get banned and rewards may be abandoned.</li>\r\n</ul>\r\n\r\n<p><big><strong>Some Important Points:-</strong></big></p>\r\n\r\n<ol>\r\n	<li>\r\n	<h3>If You found suspicious by the admin then you have to record every game you play on app. if any player refuses to do it so and &nbsp;argues with the admin action will be taken.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>If you are playing with suspicious player or confirm hacker winning be on hold (does not matter he is random or your friends ).</h3>\r\n	</li>\r\n	<li>\r\n	<h3>If any one of you fail to join the room by the match start time then we are not responsible for IT. refund in such cases won&#39;t be processed. So make you sure to join before a start time .</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Do not share the room ID and password with anyone who has not join the match. if you are found doing so, your account may get terminated and all the winning will be lost .</h3>\r\n	</li>\r\n	<li>\r\n	<h3>Make your sure to Grab ID and password and join the room before the match start time.</h3>\r\n	</li>\r\n	<li>\r\n	<h3>match will start exact on time so make you sure to come in time.</h3>\r\n	</li>\r\n	<li>If any Reason Match Not Full then Winning Prize Will Reduced</li>\r\n</ol>\r\n\r\n<p>&nbsp;This match is paid match.</p>\r\n', '2021-08-17 00:36:15'),
(11, 0, 'BGMI TDM', '<h3>&bull; Pov of Every Match Is Needed Record Your Every Match</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&bull; Recording Is Compulsory</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Join Room Before The Time Match Time Otherwise You Are Responsible For Your Loss</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&bull;If Anyone Don&#39;t Join Room Before The Time Then</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Your Are Responsible For Your Loss</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>If Anyone Founding Suspicious And He Has No Having His Match Recording Then There is no prize For That Player. All Player Have To Record Their Matches</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>Please Don&#39;t Share id and Pass Founding Sharing Id And Pass means No Prize No Reward And Ban From App</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&bull;If Any player Kills A Unregistered Player So There Is No Prize For Killing An Unregistered Player And Ban From App</h3>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<h3>&bull; BGMIAccounts with level less than 30&nbsp;will be suspended from participation. Such participants will be kicked from the room and they will not be given refund.</h3>\r\n\r\n<h3>&bull; Do not distrub any register TDM team and clan members. Do not keep changing your room slot position again to again. if you do so, you may get kicked from the room.</h3>\r\n\r\n<h3>&bull; TDM custom room cancel possible only - (4vs1), (4vs2), . (3vs2),&nbsp;(2vs1) otherwise cancel not possible.</h3>\r\n\r\n<h3>&bull; Those who do not join the room in time will receive only a 50% refund.</h3>\r\n\r\n<h3>&bull; TDM Room ID and Password will be shared in the app before 5-6 minutes of match start time.</h3>\r\n\r\n<h3>&bull; Match will start after 5-6 minutes of Sharing Room ID and Password.</h3>\r\n\r\n<h3>&bull; Make sure to grab ID and Password before the Match Start Time.</h3>\r\n\r\n<h3>&bull; Make sure you join the Match Room ASAP, before the match starts.</h3>\r\n\r\n<h3>&bull; Your network issue and game glitch this is not a owner resposcablity.</h3>\r\n', '2021-08-17 00:37:17');
