whatsoever arising from or resulting from their use of huntsmanwar.ecoshirt.xyz or their breach of the terms .</strong></p>\r\n\r\n<p><strong>Liability</strong></p>\r\n\r\n<p><strong>User agrees that neither Company nor its group companies, directors, officers or employee shall be liable for any direct or/and indirect or/and incidental or/and special or/and consequential or/and exemplary damages, resulting from the use or/and the inability to use the service or/and for cost of procurement of substitute goods or/and services or resulting from any goods or/and data or/and information or/and services purchased or/and obtained or/and messages received or/and transactions entered into through or/and from the service or/and resulting from unauthorized access to or/and alteration of user&#39;s transmissions or/and data or/and arising from any other matter relating to the service, including but not limited to, damages for loss of profits or/and use or/and data or other intangible, even if Company has been advised of the possibility of such damages.</strong></p>\r\n\r\n<p><strong>User further agrees that Company shall not be liable for any damages arising from interruption, suspension or termination of service, including but not limited to direct or/and indirect or/and incidental or/and special consequential or/and exemplary damages, whether such interruption or/and suspension or/and termination was justified or not, negligent or intentional, inadvertent or advertent.</strong></p>\r\n\r\n<p><strong>User agrees that Company shall not be responsible or liable to user, or anyone, for the statements or conduct of any third party of the service. In sum, in no event shall Company&#39;s total liability to the User for all damages or/and losses or/and causes of action exceed the amount paid by the User to Company, if any, that is related to the cause of action.</strong></p>\r\n\r\n<p><strong>Disclaimer of Consequential Damages</strong></p>\r\n\r\n<p><strong>In no event shall Company or any parties, organizations or entities associated with the corporate brand name us or otherwise, mentioned at this Website be liable for any damages whatsoever (including, without limitations, incidental and consequential damages, lost profits, or damage to computer hardware or loss of data information or business interruption) resulting from the use or inability to use the Website and the Website material, whether based on warranty, contract, tort, or any other legal theory, and whether or not, such organization or entities were advised of the possibility of such damages.</strong></p>\r\n\r\n<p><strong>Users Approval</strong></p>\r\n\r\n<p><strong>All the users who are interested in taking part at our platform agree to the terms and conditions given below.<br />\r\nUsers may accept this Agreement only:</strong></p>\r\n\r\n<p><strong>1. if such User is a natural Person, is of the legal age (18 years or more), eligibility and mental capacity to form a binding contract with us.</strong></p>\r\n\r\n<p><strong>2. if such User is a not a resident of Tamil Nadu, Andhra Pradesh, Telangana, Assam, Orissa, Kerala, Sikkim, Nagaland or Gujarat.</strong></p>\r\n\r\n<p><strong>3. if such User is a juristic Person, is lawfully existing and has all the authorizations, permits and allowances to enter into this Agreement and form a binding contract.</strong></p>\r\n\r\n<p><strong>4. such User is not legally barred, suspended or restricted from using the App.</strong></p>\r\n\r\n<p><strong>Provision of the App</strong></p>\r\n\r\n<p><strong>1. Section 12 of the Public Gambling Act, 1867 provides that games of mere skill are exempt from the application of the Act. The Supreme Court of India and various High Courts in India have opined that a game of mere skill is a game &ldquo;in which, although the element of chance necessarily cannot be entirely eliminated, success depends principally upon the superior knowledge, training, attention, experience and adroitness of the player. A game of skill is one in which the element of skill predominates over the element of chance.&rdquo; No penalty can be imposed upon a person for playing such games of skill.</strong></p>\r\n\r\n<p><strong>2. Users and Players must note that Games such as Battlegrounds India, Garena Free Fire, COD Mobile, Ludo, etc. which are available on our platform are &lsquo;Games of Skill&rsquo;, under Indian law, and that we does not support, endorse or offer users &lsquo;games of chance&rsquo; for money. While &lsquo;Games of Skill&rsquo; do not have a comprehensive definition, they are those games where the impact of a player&rsquo;s effort and skill on the outcome of a game is higher than the impact of luck and chance.</strong></p>\r\n\r\n<p><strong>3. It may be noted that States are permitted, by the Indian Constitution, to enact laws regulating betting and gambling in their respective jurisdictions. In furtherance of these powers, various States have enacted anti- gambling legislations. Such legislations are largely in concert with the Public Gambling Act of 1867 (and include the exception of &ldquo;games of skill&rdquo;). Where a State legislation on gambling exists, it prevails over the Public Gambling Act of 1867. In this regard, the Assam Game and Betting Act, 1970 and Orissa (Prevention of) Gambling Act, 1955 and Telangana State Gaming (Amendment) Ordinance and High Court Judgment in Gujarat, 2017 prohibits games with money stakes and also does not create an exception for games of skill. Therefore, currently, residents of Assam, Odisha, Telangana and Gujarat are not permitted to play and take part in any events on our platform.</strong></p>\r\n\r\n<p><strong>4. The games rules are clearly defined on this platform and all the users and participants are encouraged to read, understand and follow these rules to be successful in these games.</strong></p>\r\n\r\n<p><strong>5. The games on our platform are &lsquo;Games of Skills&rsquo;, such that the outcome / success in the games is directly dependent on the User&rsquo;s effort, performance and skills. By choosing how to play, the actions of Users shall have direct impact on the game.</strong></p>\r\n\r\n<p><strong>6. Every game will have some elements of chance, but in the form of challenges, obstacles or levels that a User would be able to overcome using his/her skills and knowledge of the game. Elements of luck are present in every game to add thrill and excitement, but no two attempts at a game are identical so Users must use their skills in order to be successful.</strong></p>\r\n\r\n<p><strong>7. Since the games available on our platform can be won through Users&rsquo; skills and such skills may be enhanced with practice and experience, the performance of a User may improve with time and practice.</strong></p>\r\n\r\n<p><strong>8. Certain games may have pre-determined outcomes (such as in Ludo Board Game), and these outcomes are achievable by Users using their skills.</strong></p>\r\n\r\n<p><strong>9. These games involves an element of financial risk and may be addictive. Please play responsibly and at your own risk.</strong></p>\r\n', 0, '2019-07-16 00:00:00', 6, '2021-12-22 11:53:29');
